import React from 'react';

const Certificates = () => {
  return (
    <section id="certificates" className="section">
      <h2>Certificates</h2>
      <div className="certificate-box">
        <ul>
          <li><a href="/images/Coursera%201.pdf" target="_blank" rel="noopener noreferrer">Certificate 1</a></li>
          <li><a href="/images/Coursera%202.pdf" target="_blank" rel="noopener noreferrer">Certificate 2</a></li>
          <li><a href="/images/Coursera%203.pdf" target="_blank" rel="noopener noreferrer">Certificate 3</a></li>
          <li><a href="/images/Coursera%204.pdf" target="_blank" rel="noopener noreferrer">Certificate 4</a></li>
          <li><a href="/images/Coursera%205.pdf" target="_blank" rel="noopener noreferrer">Certificate 5</a></li>
          <li><a href="/images/Coursera%206.pdf" target="_blank" rel="noopener noreferrer">Certificate 6</a></li>
          <li><a href="/images/Coursera%207.pdf" target="_blank" rel="noopener noreferrer">Certificate 7</a></li>
          <li><a href="/images/Coursera%208.pdf" target="_blank" rel="noopener noreferrer">Certificate 8</a></li>
          <li><a href="/images/Coursera%209.pdf" target="_blank" rel="noopener noreferrer">Certificate 9</a></li>
          <li><a href="/images/Coursera%2010.pdf" target="_blank" rel="noopener noreferrer">Certificate 10</a></li>
          <li><a href="/images/CamScanner%2011-26-2024%2018.51.pdf" target="_blank" rel="noopener noreferrer">CamScanner Certificate</a></li>
        </ul>
      </div>
    </section>
  );
};

export default Certificates;
